class Solution:    def maxProduct(self, words):        encoded = [0 for i in range(0,len(words))]                for i in range(0,len(words)):            for j in words[i]:                encoded[i] = encoded[i] | (1<<(ord(j)-ord('a')))                        print(encoded)        curr_max = 0        for i in range(0,len(words)):            for j in range(i+1,len(words)):                if encoded[i] & encoded[j] == 0:                    t = len(words[i])*len(words[j])                    if t >= curr_max:                        curr_max = t                            return curr_max                                            words = ["abcw","baz","foo","bar","xtfn","abcdef"]s = Solution()answer = s.maxProduct(words)print(answer)